
# loading binaries from string
$content = ''

$myqrcontent = ''

$null = [System.Reflection.Assembly]::Load([System.Convert]::FromBase64String($content))

function GetQRcodeFile {
    [CmdletBinding()]
    param (
        [Parameter(Mandatory=$true)]
        [string]$FileName,

        [ValidateRange(10,2000)]
        [int]$Width = 200,

        [string]$OutPath = "$env:temp\qrcode.png"
    )

    try {
        $FilePath = (Get-ChildItem $FileName -ErrorAction Stop).FullName
        $Payload = Get-Content $FilePath -Raw -Encoding UTF8
    }
    catch {
        Write-Host "[-] $($_.gettype().name) error occured: $($_)"
        return 
    }

    try {
        $generator = New-Object -TypeName QRCoder.QRCodeGenerator
        $data = $generator.CreateQrCode($Payload, 'Q')
        $code = new-object -TypeName QRCoder.PngByteQRCode -ArgumentList ($data)
        $byteArray = $code.GetGraphic($Width)
        [System.IO.File]::WriteAllBytes($outPath, $byteArray)

        $ret = [PSCustomObject]@{
            Result = $OutPath
            Width = $Width
        }
        
        return $ret
    }
    catch {
        Write-Host "[-] $($_.gettype().name) error occured: $($_)"
    }
}


function PrintQRcode {
    [CmdletBinding()]
    param (
        [parameter(Position=0, ValueFromPipeline=$true)]
        [string]$Text
    )

    begin {
        function Generate-RandomString {
            param(
                [int]$Length = 16
            )
        
            $bytes = New-Object "System.Byte[]" $Length
            $rng = [System.Security.Cryptography.RandomNumberGenerator]::Create()
            $rng.GetBytes($bytes)
        
            $chars = $bytes | ForEach-Object { [char](($_ % 62) + 48) } | Where-Object { $_ -match '[a-zA-Z0-9]' }
            return -join $chars
        }
    }

    process {
        try {
            $filename = Generate-RandomString -Length 16
            [System.IO.File]::WriteAllBytes("$($env:temp)\$($filename).exe", [System.Convert]::FromBase64String($myqrcontent))
            & "$($env:temp)\$($filename).exe" -s $Text
        }
        catch {
            Write-Host "[-] $($_.gettype().name) error occured: $($_)"
        }
    }

    end {
        remove-item "$($env:temp)\$($filename).exe" -Force
    }
}


Set-Alias Get-QRcode GetQRcodeFile
Set-Alias Print-QRcode PrintQRcode
